import DataTable from 'react-data-table-component';
import React, { useState, useEffect } from 'react';

export default function Cablecom(url){
    var urlfecht= url
    const [data, setData] = useState({});
    useEffect(()=>{
      fetch(urlfecht)
        .then(response => response.json())
        .then((data) => setData(data));
      },[]);

      const columns = [
        {
          name: 'Frase',
          selector: 'data.quote',
          sortable: true,
        },
        {
          name: 'Personaje',
          selector: 'data.character',
          sortable: true,
        },
        {
          name: 'Imagen',
          selector: 'data.image',
          sortable: true,
        },
        {
          name: 'Politica',
          selector: 'characterDirection',
        },
      ];


    return(
        <DataTable
        columns={columns}
        data={data}
      />
    )

}
